// angular import
import { CommonModule } from '@angular/common';
import { HttpErrorResponse } from '@angular/common/http';
import { Component } from '@angular/core';
import { FormControl, FormGroup, ReactiveFormsModule, Validators } from '@angular/forms';
import { ActivatedRoute, Router, RouterModule } from '@angular/router';
import { NgxSpinnerModule, NgxSpinnerService } from 'ngx-spinner';
import { AuthResponseDto } from 'src/app/theme/shared/interfaces/AuthResponseDto.model';
import { AuthenticationService } from 'src/app/theme/shared/services/authentication.service';
import Swal from 'sweetalert2';
import { Title } from '@angular/platform-browser';

@Component({
  selector: 'app-login',
  standalone: true,
  imports: [RouterModule,NgxSpinnerModule,ReactiveFormsModule,CommonModule],
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.scss']
})
export default class LoginComponent {
  loginForm: any;
  errorMessage: string = '';
  showErrorMsg: boolean;
  returnUrl: string;
  constructor(
     private service: AuthenticationService,
     private router: Router,
     private route: ActivatedRoute,
     private spinner: NgxSpinnerService,
  ) {}

  ngOnInit(): void {
    this.showErrorMsg=false;
    localStorage.clear();
    this.loginForm = new FormGroup({
      email: new FormControl('', [Validators.required, Validators.email]),
      password: new FormControl('', Validators.required)
    });
    this.returnUrl = this.route.snapshot.queryParams['returnUrl'] || '/';
  }

    onFormSubmit() {
    this.spinner.show();
    this.showErrorMsg = false;
    const formValues = this.loginForm.value;
    console.log(formValues)
    this.service.loginUser(formValues)
    .subscribe({
      next: (res:AuthResponseDto) => {
       localStorage.setItem("token", res.token);
       const name = this.service.getCurrentUser().name;
       const role = this.service.getCurrentUser().role;
       localStorage.setItem("currentUser", name);
       localStorage.setItem("currentRole", role);
       this.service.sendAuthStateChangeNotification(res.isAuthSuccessful);
       this.router.navigate([this.returnUrl]);
      this.spinner.hide();
    },
    error: (err: HttpErrorResponse) => {
      this.errorMessage = err.message;
      this.showErrorMsg = true;
      Swal.fire('', err.message, 'error');
      this.spinner.hide();
    }});
   }

  validateControl(controlName: string) {
    return this.loginForm.get(controlName).invalid && this.loginForm.get(controlName).touched;
  }

  hasError (controlName: string, errorName: string) {
    return this.loginForm.get(controlName).hasError(errorName)
  }
  sumbitBtnLogin(){
    this.router.navigate(["/dashboard/default"]);
  }
}
<div class="auth-main">
  <div class="auth-wrapper v3">
    <div class="auth-form">
      <div class="auth-header">
        <div class="text-start">
          <img src="assets/images/logo-icon.svg" alt="theme-logo" class="logo logo-dark logo-lg" />
          <label class="fs-5 fw-bolder">RGL_TMS</label>
        </div>
      </div>
      <!-- <div *ngIf="showErrorMsg" class="alert alert-danger card" role="alert">
        <span [innerHTML]="errorMessage"></span>
      </div> -->
      <div class="card my-3">
        <div class="card-body">
          <div class="d-flex justify-content-between align-items-end mb-4">
            <h3 class="mb-0"><b>Login</b></h3>
          </div>
          <form [formGroup]="loginForm">
          <div class="form-group mb-3">
            <label class="form-label" for="email">Email Address</label>
            <input type="email" class="form-control" formControlName="email" placeholder="Email Address"/>
            <div>
              <label class="e-error" *ngIf="validateControl('email') && hasError('email', 'required')">*Email is required</label>
              <label class="e-error" *ngIf="validateControl('email') && hasError('email', 'email')">*Please provide a valid email</label>
            </div>
          </div>
          <div class="form-group mb-3">
            <label class="form-label" for="password">Password</label>
            <input type="password" class="form-control" formControlName="password" placeholder="Password"/>
            <div>
              <label class="e-error" *ngIf="validateControl('password') && hasError('password', 'required')">*Password is required</label>
            </div>
          </div>
          <div class="d-flex mt-1 justify-content-between">
            <div class="form-check">
              <input class="form-check-input input-primary" type="checkbox" id="customCheckc1" checked="" />
              <label class="form-check-label text-muted" for="customCheckc1">Keep me sign in</label>
            </div>
            <!-- <h5 class="text-secondary f-w-400"><a href="javascript:">Forgot Password?</a></h5> -->
          </div>
          <div class="d-grid mt-4">
            <button type="button" class="btn btn-primary" [disabled]="!this.loginForm.valid" (click)="onFormSubmit()">Login</button>
          </div>
        </form>
          <div class="text-center mt-3">
            <small>
              <label style="color: #145DA0">RGL TMS Version (1.0.0.0)</label><br />
              Powered by INS Co,.Ltd
              <br />
           </small>
          </div>
        </div>
      </div>
      <div class="auth-footer row">
        <div class="col my-1">
          <p class="m-0">
            Copyright ©2024
          </p>
        </div>
      </div>
    </div>
  </div>
</div>
